user_prompt:
Define the full set `S` as all 3 integers from `0` to `2`.

Your task is to partition `S` into two **disjoint subsets** `S1` and `S2` such that:
- `S1 ∪ S2 = S` and `S1 ∩ S2 = ∅`
- For each of the following 3 subsets (each a subset of `S`), the subset is **not fully contained** in either `S1` or `S2`. That is, each subset must contain **at least one element from S1** and **at least one element from S2`.

The list of 3 subsets is as follows:
{ 2, 1, 0 }
{ 1, 2, 0 }
{ 0, 2 }

**Output Format:** Your final answer should be a single line containing the elements of `S1`, separated by spaces. (Subset `S2` is implicitly defined as `S \ S1`.)
